CREATE OR REPLACE FUNCTION 	get_all_ceb_meters	() RETURNS TABLE(
med	integer	,
id	text	,
nome	text	,
modtar	text	,
contrato	text	,
classe	text	,
subclasse	text	,
grupo	text	,
subgrupo	text	,
ligacao	text	,
dcf	integer	,
dcp	integer	,
locais	text[]	)
LANGUAGE plpgsql AS $$ BEGIN	 	 
RETURN QUERY SELECT	 	 
a.med,	 	 
a.id,	 	 
a.nome,	 	 
a.modtar,	 	 
a.contrato,	 	 
a.classe,	 	 
a.subclasse,	 	 
a.grupo,	 	 
a.subgrupo,	 	 
a.ligacao,	 	 
a.dcf,	 	 
a.dcp,	 	 
ARRAY(SELECT b.asset_id FROM ceb_meters_assets AS b WHERE b.med = a.med)	 	 
FROM ceb_meters AS a	 	 
ORDER BY a.med;	 	 
END; $$;	 	 
		
CREATE OR REPLACE FUNCTION 	get_ceb_bills	(integer, integer, integer) RETURNS SETOF ceb_data
LANGUAGE plpgsql AS $$ BEGIN	  	  
IF $1 = 199 THEN RETURN QUERY SELECT * FROM 	ceb_data	  
WHERE TRUE AND	aamm	BETWEEN $2 AND $3
ORDER BY	ceb_data.med, ceb_data.aamm;	  
ELSE RETURN QUERY SELECT * FROM 	ceb_data	  
WHERE med = $1 AND aamm BETWEEN $2 AND $3	  	  
ORDER BY ceb_data.aamm;	  	  
END IF;	  	  
END; $$;	  	  
		
CREATE OR REPLACE FUNCTION 	get_all_caesb_meters	() RETURNS TABLE(
med	integer	,
id	text	,
nome	text	,
contrato	text	,
hidrom	text	,
cat	integer	,
locais	text[]	)
LANGUAGE plpgsql AS $$ BEGIN	 	 
RETURN QUERY SELECT	 	 
a.med,	 	 
a.id,	 	 
a.nome,	 	 
a.contrato,	 	 
a.hidrom,	 	 
a.cat,	 	 
ARRAY(SELECT b.asset_id FROM caesb_meters_assets AS b WHERE b.med = a.med) AS locais	 	 
ORDER BY a.med;	 	 
END; $$;	 	 
		
CREATE OR REPLACE FUNCTION	get_caesb_bills	(integer, integer, integer) RETURNS SETOF caesb_data
LANGUAGE plpgsql AS $$ BEGIN	 	 
IF $1 = 299 THEN RETURN QUERY SELECT * FROM	caesb_data	 
WHERE TRUE AND	aamm	BETWEEN $2 AND $3
ORDER BY	caesb_data.med, 	caesb_data.aamm;
ELSE RETURN QUERY SELECT * FROM	caesb_data	 
WHERE med = $1 AND aamm BETWEEN $2 AND $3 ORDER BY caesb_data.aamm;	 	 
END IF;	 	 
END; $$;	 	 
		
CREATE OR REPLACE FUNCTION	get_asset	(text) RETURNS TABLE(
-- Attributes from assets table	 	 
id	text	,
nome	text	,
subnome	text	,
visita	boolean	,
lat	real	,
lon	real	,
areaconst	real	,
modelo	text	,
serie	text	,
tipo	text	,
-- Attributes from other tables	 	 
parent	text	,
list_wos	integer[]	)
LANGUAGE plpgsql AS $$ BEGIN	 	 
RETURN QUERY SELECT	 	 
-- Attributes from assets table	 	 
a.id,	 	 
a.nome,	 	 
a.subnome,	 	 
a.visita,	 	 
a.lat,	 	 
a.lon,	 	 
a.areaconst,	 	 
a.modelo,	 	 
a.serie,	 	 
a.tipo,		 
-- Attributes from other tables	 	 
(SELECT b.parent AS parent FROM assets_parents AS b WHERE b.id = $1),	 	 
ARRAY(SELECT c.wo_id FROM wos_assets AS c WHERE c.asset_id = $1) AS list_wos	 	 
FROM assets AS a	 	 
WHERE a.id = $1;	 	 
END; $$;	 	 
		
CREATE OR REPLACE FUNCTION	get_all_assets	() RETURNS TABLE(
-- Attributes from assets table	 	 
id	text	,
nome	text	,
subnome	text	,
visita	boolean	,
lat	real	,
lon	real	,
areaconst	real	,
modelo	text	,
serie	text	,
tipo	text	,
-- Attributes from other tables	 	 
parent	text	,
list_wos	integer[]	)
LANGUAGE plpgsql AS $$ BEGIN	 	 
RETURN QUERY SELECT	 	 
-- Attributes from assets table	 	 
a.id,	 	 
a.nome,	 	 
a.subnome,	 	 
a.visita,	 	 
a.lat,	 	 
a.lon,	 	 
a.areaconst,	 	 
a.modelo,	 	 
a.serie,	 	 
a.tipo,	 	 
-- Attributes from other tables	 	 
(SELECT b.parent AS parent FROM assets_parents AS b WHERE b.id = a.id),	 	 
ARRAY(SELECT c.wo_id FROM wos_assets AS c WHERE c.asset_id = a.id) AS list_wos	 	 
FROM assets AS a	 	 
ORDER BY a.id;	 	 
END; $$;	 	 
		
		
		
